    // * Metodo que envia una solicitud POST para obtener el token
    // * y lee el valor access_token de la respuesta JSON
    private String getAccessToken() throws Exception {
        final MultiValueMap<String, String> params = new LinkedMultiValueMap<>();
        params.add("grant_type", "client_credentials");
        params.add("client_id", CLIENT_ID);

        MvcResult result = mockMvc.perform(post("/oauth/token")
                        .params(params)
                        .with(httpBasic(CLIENT_ID, CLIENT_SECRET))
                        .accept(CONTENT_TYPE))
                .andExpect(status().isOk())
                .andExpect(content().contentType(CONTENT_TYPE))
                .andReturn();

        String responseJson = result.getResponse().getContentAsString();
        System.out.println("\naccess_token: " + responseJson + "\n");

        JacksonJsonParser jsonParser = new JacksonJsonParser();
        return jsonParser.parseMap(responseJson).get("access_token").toString();
    }

